// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title Helloworld
 * @dev A simple smart contract that stores and emits a greeting message.
 * @custom:dev-run-script ./scripts/deploy_caculator_with_ethers.ts
 */
contract Calculator {
    int16 private currentValue;
    // Event emitted when an addition operation is performed
    event Addition(int256 indexed num1, int256 indexed num2, int256 result);

    // Event emitted when a subtraction operation is performed
    event Subtraction(int256 indexed num1, int256 indexed num2, int256 result);

    /**
     * @dev Constructor function to initialize the contract with a default greeting message.
     */
    constructor() {
        currentValue = 0;
    }

    /**
     * @dev Function to perform addition
     * @param value The addition value
     */
    function add(int16 value) external {
        currentValue += value;
        emit Addition(currentValue - value, value, currentValue);
    }

    /**
     * @dev Function to perform subtraction
     * @param value The subtraction value
     */
    function subtract(int16 value) external {
        currentValue -= value;
        emit Subtraction(currentValue + value, value, currentValue);
    }

    /**
     * @dev Function to get the current result
     * @return The current greeting message.
     */
    function getCurrentValue() external view returns (int16) {
        return currentValue;
    }
}

/**
 * @dev This is the end of the Calculator contract.
 */

